import React from 'react';
import './App.css';

function App() {
  return (
    <div className="App">
      <div className="Background">
        <canvas className="canvas"></canvas>
      </div>
      <header className="App-header">
        <b>Y<span>3</span>k</b>
      </header>
    </div>
  );
}

export default App;
